import { useEffect, useState, useRef } from "react";
import OutputNode from "./outputNode";
import InputNode from "./inputNode";
import PatchCable from "./patchCable";

const Patchbay = () => {
  const svgRef = useRef(null);

  const outs = 8;
  const ins = 8;

  return (
    <div className="h-[300px] w-[700px] bg-slate-300">
      <svg viewBox="0 0 700 300" ref={svgRef}>
        {[...Array(ins)].map((n, i) => (
          <InputNode i={i} />
        ))}
        {[...Array(outs)].map((n, i) => (
          <OutputNode i={i} />
        ))}
        <PatchCable />
      </svg>
    </div>
  );
};

export default Patchbay;
